import React from 'react'
import './home.css';

const Home = () => {

  const redirectToForm = () => {
    window.location.href = '/rform';
  }

  return (
    <div className="home">
      <div className="hcon">
        <h1 className="htitle"><i class="fa-solid fa-cloud"></i>&nbsp;&nbsp; Welcome to Cloud Service Recommendation</h1>
        <center><h3>Fill this form to get your recommendations</h3></center>
        <button onClick={redirectToForm}>Get Recommendations</button>
      </div>
    </div>
  )
}

export default Home;
